import { StyleSheet } from "react-native"

export default StyleSheet.create({

    box: {
        alignItems: 'center',
        justifyContent: 'space-evenly',
        borderWidth: 1,
        borderColor: 'black',
        width: '60vw',
        height: '60vh',
    },
    page: {
        alignItems: 'center',
    },
    input: {
        margin: 5,
        padding: 5,
    },
    entrar: {
        backgroundColor: 'white',
        textAlign: 'center',
        width: '100%',
        margin: 5,
        padding: 10
    },
    tInput: {
        borderWidth: 1,
        borderColor: "#ccc",
        borderRadius: 7,
        margin: 5,
        padding: 10
    }
})
